get.description:
This API returns JSON containing tenant name as well as API key token for the specified tenant.  

GET = https://api.servicetitan.com/v1/apikeys?{query-string}

Access to this API is allowed only for global users with GetApiKey permission. Users with Admin role have it by default. Please contact **alliances@servicetitan.com** to make sure the user you plan to use for querying this API has this permission.

put.description:
PUT requests are used to update bookings. The PUT request allows to identify booking by its ServiceTitan identity.

PUT = https://api.servicetitan.com/v1/bookings/{id} 

It is possible to update only booking instances where status is 'New'. Once a booking is converted to real Job or dismissed by, updates are not accepted.

PUT requests are used to update bookings. The PUT request looks for a booking instance to be updated by its Id in an external system.

PUT = https://api.servicetitan.com/v1/bookings/external/{id} 

It is possible to update only booking instances where status is 'New'. Once a booking is converted to real Job or dismissed by, updates are not accepted.
